import styles from "../styles/Skills.module.css";

const Skills = () => {
  return (
    <div className={styles.all}>
      <h1 style={{ marginBottom: "2%", color: "#167c9e", fontSize: "30px" }}>
        Skills
      </h1>
    </div>
  );
};

export { Skills };
